id: lessonpart2
title: Scroll Direction
content: |+
  The default behavior of a marquee tag is to endlessly scroll text across the page from the right side to the left side.

  ```html
  <marquee>This text will scroll from right to left</marquee>
  ```

  But what if you want to scroll the text in a different direction? Well, that's exactly what the  **direction**Â attribute is for! You can use this attribute to specify the direction the text will travel across the page. The default value for this attribute is "left", but you can use any of the cardinal directions to switch things up!

  ```html
  <marquee direction="left">
    This text will scroll from right to left
  </marquee>

  <marquee direction="right">
    This text will scroll from left to right
  </marquee>

  <marquee direction="up">
    This text will scroll from bottom to top
  </marquee>

  <marquee direction="down">
    This text will scroll from top to bottom
  </marquee>
  ```

  Try running this code in the editor to the right to see how each of the animations looks when it plays!

  <br />

  ![1.00](data:image/gif;base64, "The text \"Eat More Turnips\" animating in a marquee tag")

showEditor: true
editors:
  - course1/unit1/lesson1/lessonpart2/index.html
questionGroups:
  - id: "1"
    questions:
      - id: "1"
        type: choice
        content: Which of the following directions will produce the animation of the
          "Eat more turnips" text in the above GIF?
        options:
          - id: "1"
            value: up
          - id: "2"
            value: down
          - id: "3"
            value: left
            isCorrect: true
          - id: "4"
            value: right
